import React from 'react';
import Grid from '@material-ui/core/Grid';
import { FILTER_LABELS } from '../../../../shared/constants/stringConstantsSelectors';
import { MOVIE_SETS } from '../../../../shared/constants/domainConstantSelectors';
import { DropDown } from '../../singleSelect';

export const MovieSetFilters = props => {
    return (
        <Grid item xs={2}>
            <DropDown 
                handleFilterChange={props.handleFilterChangeByMovieSet} 
                inputLabel={FILTER_LABELS.MOVIE_SETS}
                menuItems={MOVIE_SETS}
            />
        </Grid>  
    );
};
